import React, { useState } from "react";
import { List, arrayMove } from "react-movable";

import "../styles/PlaceBoard.css";

export default function PlaceBoard(placeCardInfo, setPlaceCardInfo){
    const [placeCount, setPlaceCount] = useState(placeCardInfo.length);

    if(placeCount==0){
        return(
            <>
            <div id="placeBoard">
                Added places will appear here 
            </div>
            </>
        );
    }
    else{
        return(
            <>
            <div id="placeBoard">
            <List
                values={placeCardInfo}
                onChange={({ oldIndex, newIndex }) =>
                    setPlaceCardInfo(arrayMove(placeCardInfo, oldIndex, newIndex))
                }
                renderList={({ children, props }) => <ul {...props}>{children}</ul>}
                renderItem={({ value, props }) => <li {...props}>{value}</li>}
            /> 
            </div>
            </>
        );
    }

}
